Verenigd Koninkrijk / Verenigde Staten
Drama / Fantasy
104 minuten

een mooie film

met Christina Ricci, James McAvoy en Richard E. Grant

Penelope is een jonge vrouw, die door toedoen van een vloek op haar familie, is geboren met het gezicht van een varken, wat ze 
nog altijd op allerlei manieren tracht te verbergen. Vooral ook omdat een fotograaf er op gebrand is haar te fotograferen. In de 
tussentijd tracht Penelope er alles aan te doen de vloek te verbreken en daarbij stuit ze op een jongeman op wie ze verliefd 
wordt..
